import React from 'react';

export default function Refrencias (){
    return(
        <>
            <h2>Referencias</h2>
            <button id="menu-btn">Menú</button>
            <nav id="menu">
                <a href="">Sección 1</a><a href="">Sección 2</a><a href="">Sección 3</a>
                <a href="">Sección 4</a><a href="">Sección 5</a>
            </nav>
        </>
    )
}
